import React from "react";
import './advert.css';

const Advert = ({data}) => {
    const __TYPE__ = data.type;
    const __URL__ = data.url;
    const __NAME__ = data.name;
    const __PRICE__ = data.price;
    const __DOP__ = data.dop;
    const __DATA__ = data.data;

    return (
        <div class="advert">
            <div className="id">
                <span className="id-name">
                    {__TYPE__}
                </span>
                <img src="https://img.icons8.com/color/48/null/checked--v1.png" alt="icon" className="id-icon"/>
            </div>
            <img src={__URL__} alt="photo" className="photo"/>
            <div className="advert-info">
                <div className="">
                    <div className="name">
                        <span className="city-name">{__NAME__}</span>
                    </div>
                    <div className="city-price">
                        <span>{__PRICE__}</span>
                    </div>
                    <p>
                        {__DOP__}
                    </p>
                    <div className="sub-info">
                        <span className="data">
                            {__DATA__}
                        </span>
                        <img src="https://img.icons8.com/sf-regular/48/FA5252/like.png" alt="icon" className="heart"/>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Advert;
